import React from 'react';
import {Route} from 'react-router-dom';

import {LoginForm} from 'modules'

import './Auth.scss'

const Auth = () => (
    <section className="auth">
            <div className="auth__content">
                <Route path="/:(|/login)" component={LoginForm} />
                <Route path="/register" render={() => {
                    <h1>Helloo</h1>
                }} />

            </div>
        </section>
);




export default Auth;
